import React, { useEffect } from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';
import className from 'classnames';
import TopbarSidebarButton from '../components/topbar/TopbarSidebarButton';
import StickyMenu from '../../Landing/lib/StickyMenu';
import Navigation from '../../Landing/components/Navigation';
import { LineLogIn } from '../../Landing/components/LineLogIn/LineLogin';
import logo71 from '../../Landing/assets/images/logo71.png';

import style from '../../Landing/landing.scss';

const Topbar = ({
  changeMobileSidebarVisibility, changeSidebarVisibility,
}) => {
  useEffect(() => {
    StickyMenu();
  });
  return (
    <header className={`appie-header-area appie-sticky ${className || ''}`}>
      <div className="container">
        <div className="col-lg-6 col-md-6 col-sm-6 col-6 order-1 order-sm-1">
          <div className="text-left">
            <TopbarSidebarButton
              onClickMobile={changeMobileSidebarVisibility}
              onClickDesktop={changeSidebarVisibility}
            />
          </div>
        </div>
        <div className="col-lg-6  col-md-6 col-sm-6 col-6 order-2 order-sm-2">
          <div className="text-right">
            <div className="appie-logo-box">
              <a href="/">
                <img src={logo71} alt="" />
              </a>
            </div>
          </div>
        </div>
      </div>
    </header>
  );
};

Topbar.propTypes = {
  changeMobileSidebarVisibility: PropTypes.func.isRequired,
  changeSidebarVisibility: PropTypes.func.isRequired,
};

export default Topbar;
